import Button from '@mui/material/Button';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import './App.css';


function App() {
  return (
    <header>
      <div>
        <div className="div-left">
          <ul>

              <li><Button variant="contained" startIcon={<AccountCircleIcon />}>USER A</Button></li>
              <li><Button variant="contained">MAIN</Button></li>
              <li><Button variant="contained">SITE1</Button></li>
              <li><Button variant="contained">SITE2</Button></li>
              <li><Button variant="contained">SITE3</Button></li>
              <li><Button variant="contained">SITE4</Button></li>
              <li><Button variant="contained">SITE5</Button></li>
              <li><Button variant="contained">SITE6</Button></li>
          </ul>
        </div>
        <div className="div-right">
          <h1>Lora IoT Management System</h1>
        </div>
      </div>
    </header>
  );
}

export default App;
